////////////   MOMENTUM
function momentum(data_set, period, test, msg){
  var tech = new Rickshaw.Technicals.Momentum();
	var results = sample_data.results.momentum[data_set];
  var data = tech.calc({
    datum: sample_data,
    period: period
	});

  for(var i in data.momentum){
		test.equal(data.momentum[i].y, results.momentum[i].y, msg);
  }
  test.done();
}
exports.randMomentum = function(test) {
  var period = {'p' : 30};
  momentum('prime', period, test, 'prime momentum');
};


